// SPDX-License-Identifier: MIT OR LGPL-2.0-or-later
pragma solidity ^0.8.5;

import "./Ownable.sol";

/**
 * @dev Contract module which provides a basic storage system.
 *
 * This module is used through inheritance. It will make available the contract
 * addresses created, owners/flight bookers of the escrow contract and record detailing 
 * detailing how much is withdrawable from the escrow.
 */
contract ExternalStorage {

    uint256 internal _totalIssued;
    uint256 internal _totalRedeemed;
    uint256 internal _totalSupply;

    address[] internal admins;
    address[] internal authorizers;
    address[] internal airlinesList;
    address[] internal usersList;
    address[] internal blackList;

    mapping(address => bool) public isAdmin;
    mapping(address => bool) public isAuthorizer;
    mapping(address => bool) public isAirLineListed;
    mapping(address => bool) public isUserListed;
    mapping(address => bool) public isBlackListed;

    string internal constant SuperAdmin = "SuperAdmin";

    APDetails internal apDetails;
    EscrowDetails public escrows;

    mapping(address => AirlineDetails) public Airlines;
    mapping(address => PassengerDetails) public Passengers;
    mapping(address => PassengerClaims) public PassengerClaim;
    mapping(address => EscrowPassengers) public flightPassengers;
    mapping(address => RefundSettings) public refunds;

    mapping(string => address) superAdmin;
    mapping(address => AdminDetails) Admins;

    //Events for UserManagement
    event AdminAdded(address indexed Admin);
    event AdminRemoved(address indexed Admin);
    event AuthorizerAdded(address indexed Authorizer);
    event AuthorizerRemoved(address indexed Authorizer);
    event SetUserListEvent(address indexed User);
    event RemovedUserList(address indexed User);
    event SetBlackListEvent(address indexed EvilUser);
    event RemoveUserBlackList(address indexed RedeemedUser);

    enum FlightStatus {PENDING, DELAYED, ONGOING, COMPLETED, CANCELLED}

    //Refund settings
    struct RefundSettings {
        uint32 FLIGHT_REFUND;
        uint32 BOOKING_REFUND;
        uint32 DELAYED_REFUND;
    }

    //Admin Details
    struct AdminDetails {
        address AdminID;
        bytes32 AdminName;
        address AddedBy;
    }

    //Struct for Aeropaye detail
    struct APDetails {
        address APAddr;
        bytes32 PhoneAP;
        bytes32 EmailAP;
    }

    //Struct for Airline detail
    struct AirlineDetails {
        address AirlineAddr;
        bytes32 NameAirline;
        bytes32 PhoneAirline;
        bytes32 EmailAirline;
    }


    //Struct for Passenger detail
    struct PassengerDetails {
        address PassengerAddr;
        bytes32 NamePassenger;
        bytes32 PhonePassenger;
        bytes32 EmailPassenger;
    }

    //Struct for Passenger booking detail
    struct PassengerBookingDetails {
        address FlightID; //escrow address
        address BookedBy; //paid by
        string FlightClass;
        uint256 FlightCost;
        uint256 FlightCostClaimed;
        uint256 FlightStatus;
        string FlightSeat;
        uint256 FlightRefund;
        bool CheckedIn;
    }

    //Struct for Passenger claims record
    struct PassengerClaims {
        uint256 TotalAmountClaimed;
        uint256 NumberOfPassengers;
    }

    //Struct for Escrow passengers amount paid
    struct EscrowPassengers {
        address FlightID; //escrow address
        mapping(address => PassengerBookingDetails[]) passengers;
    }

      //Struct for Escrow detail
    struct EscrowDetails {
        address AirlineID; //airline address
        string FlightCode; //flight code
        string FlightDeparture; 
        string FlightArrival;
        string FlightTime;
        uint256 FlightCost;
        uint32 FlightStatus;
        uint256 FlightRefund;
        uint256 BookingRefund;
        uint256 DelayRefund;
    }
}
